let page=getQueryVariable('page');pages=document.querySelectorAll('[data-page]');for(let i=0;i<pages.length;i++){pages[i].style.display='none';}if(getQueryVariable('page')!=false){if(document.querySelector('[data-page='+page+']')!=null){document.querySelector('[data-page=' + page + ']').style.display='block';}}